`timescale 1 ns / 1 ns
module mii_if_3c48db7e8f7a4061b4268f003b844934
(
//Globle Signals
input                           tx_mac_aclk,
output  reg                     tx_mac_aclk_en,
input                           tx_reset,
output  wire                    rx_mac_aclk,
output  reg                     rx_mac_aclk_en,
input                           rx_reset,
//Configuration Signals
input           [2:0]           eth_speed,
//GMII Interface
output  reg     [7:0]           gm_rx_d,
output  reg                     gm_rx_dv,
output  reg                     gm_rx_err,
input           [7:0]           gm_tx_d,
input                           gm_tx_en,
input                           gm_tx_err,
//MII Interface
input                           mii_txc,
output  reg     [3:0]           mii_txd,
output  reg                     mii_tx_dv,
output  reg                     mii_tx_err,

input                           mii_rxc,
input           [3:0]           mii_rxd,
input                           mii_rx_dv,
input                           mii_rx_err

//Status and  Error Signals
);
// Parameter Define 
//localparam                      SPEED_100M_DIV = (TX_REFCLK == 125) ? 10 : 2;
//localparam                      SPEED_10M_DIV  = SPEED_100M_DIV*10;
//localparam                      SPEED_CLK_DIV = (TX_REFCLK == 125) ? SPEED_100M_DIV/2 + 1 : 0 ;
// Register Define 
reg     [6:0]                   aclk_en_cnt;
reg     [3:0]                   txd;
reg                             tx_en;
reg                             tx_er;
reg                             rx_dv_pre;
reg                             rx_dv_dl1;
reg     [3:0]                   rxd_pre;
reg     [3:0]                   rxd_dl1;
reg                             rx_odd_data_ptr;
reg     [3:0]                   rxd;
reg                             rx_dv;
reg                             rx_er;
reg     [3:0]                   gm_tx_d_h;
reg     [7:0]                   gm_tx_d_r;
reg                             gm_tx_en_r;
reg                             gm_tx_err_r;
reg				preamble_flg;
reg     [1:0]			cur_st;
reg     [1:0]			nxt_st;
reg				add_preamble;

// Wire Define

/*----------------------------------------------------------------------------------*\
                                 The main code
\*----------------------------------------------------------------------------------*/

/*----------------------- Tx Region ----------------------------*/

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_mac_aclk_en <= 1'b0;
    else
        tx_mac_aclk_en <= ~tx_mac_aclk_en;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        gm_tx_d_r <= 8'h0;
    else if((gm_tx_en == 1'b1) && (tx_mac_aclk_en == 1'b1))
        gm_tx_d_r <= gm_tx_d;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        gm_tx_en_r <= 1'b0;
    else if(tx_mac_aclk_en == 1'b1)
        gm_tx_en_r <= gm_tx_en;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        gm_tx_err_r <= 1'b0;
    else if(tx_mac_aclk_en == 1'b1)
        gm_tx_err_r <= gm_tx_err;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        txd <= 4'h0;
    else if(gm_tx_en_r == 1'b1) 
        begin
            if(tx_mac_aclk_en == 1'b0)
                txd <= gm_tx_d_r[3:0];
            else
                txd <= gm_tx_d_r[7:4];
        end
    else;    
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_en <= 1'b0;
    else 
        tx_en <= gm_tx_en_r;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_er <= 1'b0;
    else 
        tx_er <= gm_tx_err_r;
end

always @(posedge mii_txc)
begin 
    mii_tx_dv  <= tx_en;
    mii_txd    <= txd[3:0];
    mii_tx_err <= tx_er;
end
/*----------------------- Rx Region ----------------------------*/
always @(posedge mii_rxc)
begin
   if(mii_rxd==4'hd && mii_rx_dv && !mii_rx_err && cur_st==2'b01 && preamble_flg)
   begin
      rxd   <= 4'h5;
      rx_dv <= 1'b1;
   end
   else if(add_preamble)
   begin
      rxd <= rxd_pre;
      rx_dv <= rx_dv_pre;
   end
   else
   begin
      rxd   <= mii_rxd;
      rx_dv <= mii_rx_dv;
      rx_er <= mii_rx_err;
   end
end

assign rx_mac_aclk = mii_rxc;

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
	begin
	rxd_pre <= 4'h0;
	rx_dv_pre <= 1'b0;
	end
    else if((mii_rxd==4'hd && mii_rx_dv && !mii_rx_err && cur_st==2'b01 && preamble_flg) || add_preamble)
	begin
	rxd_pre <= mii_rxd;
	rx_dv_pre <= mii_rx_dv;
	end
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
	add_preamble <= 1'b0;
    else if(mii_rxd==4'hd && mii_rx_dv && !mii_rx_err && cur_st==2'b01 && preamble_flg)
	add_preamble <= 1'b1;
     else if(!mii_rx_dv)
	add_preamble <= 1'b0;
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        rx_mac_aclk_en <= 1'b0;
    else
        rx_mac_aclk_en <= ~rx_mac_aclk_en;
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
	begin
		cur_st <= 2'b00;
	end
     else
	begin
		cur_st <= nxt_st;
	end
end

always @*
begin
case(cur_st)
2'b00: begin
	if(mii_rxd==4'h5 && mii_rx_dv && !mii_rx_err)	
	nxt_st <= 2'b01;
	else
	nxt_st <= 2'b00;
       end
2'b01: begin
	if(mii_rxd==4'hd && mii_rx_dv && !mii_rx_err)
	nxt_st <= 2'b10;
	else if (mii_rxd==4'h5 && mii_rx_dv && !mii_rx_err)
	nxt_st <= 2'b01;
	else 
	nxt_st <= 2'b00;
	end
2'b10: begin
	if(mii_rx_dv) 
	nxt_st <= 2'b10;
	else
	nxt_st <= 2'b00;
	end
default: nxt_st <= 2'b00;
endcase
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        begin
            preamble_flg <= 1'b0;
	end
    else if(mii_rxd==4'h5 && mii_rx_dv && !mii_rx_err && cur_st==2'b01)
	begin
	    preamble_flg <= ~preamble_flg;
	end
    else begin
	    preamble_flg <= 1'b0;
	end
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        begin
            rx_dv_dl1 <= 1'b0;
            rxd_dl1 <= 4'h0;
        end
    else
        begin
            rx_dv_dl1 <= rx_dv;
            rxd_dl1 <= rxd;
        end
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        gm_rx_dv <= 1'b0;
    else
        gm_rx_dv <= rx_dv_dl1;
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        rx_odd_data_ptr <= 1'b0;
    else if(rx_dv == 1'b0)
        rx_odd_data_ptr <= 1'b0;
    else
        rx_odd_data_ptr <= ~rx_odd_data_ptr;
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        gm_rx_d <= 8'h0;
    else if((rx_dv == 1'b1) && (rx_odd_data_ptr == 1'b1))
        gm_rx_d <= {rxd[3:0],rxd_dl1[3:0]};
    else;
end

always @(posedge rx_mac_aclk or posedge rx_reset)
begin
    if(rx_reset == 1'b1)
        gm_rx_err <= 1'b0;
    else
        begin
            if(rx_er == 1'b1)
                gm_rx_err <= 1'b1;
            else if(rx_mac_aclk_en == 1'b1)
                gm_rx_err <= 1'b0;
        end
end


endmodule



