reg                             tx_er;
reg     [1:0]                   txc;
reg                             rx_dv_dl1;
reg     [7:0]                   rxd_dl1;
reg                             rx_odd_data_ptr;

// Wire Define
wire                            rx_dv;
wire    [7:0]                   rxd;
wire                            rx_er;

/*----------------------------------------------------------------------------------*\
                                 The main code
\*----------------------------------------------------------------------------------*/

/*----------------------- Tx Region ----------------------------*/
always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        aclk_en_cnt <= 7'd0;
    else if((eth_speed == 3'h4) ||
            ((eth_speed == 3'h2) && (aclk_en_cnt == 7'd9)) ||
            ((eth_speed == 3'h1) && (aclk_en_cnt == 7'd99)))
        aclk_en_cnt <= 7'd0;
    else
        aclk_en_cnt <= aclk_en_cnt + 1'b1;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_mac_aclk_en <= 1'b0;
    else if(aclk_en_cnt == 7'd0)
        tx_mac_aclk_en <= 1'b1;
    else
        tx_mac_aclk_en <= 1'b0;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        txd[7:4] <= 4'h0;
    else if((gm_tx_en == 1'b1) && (tx_mac_aclk_en == 1'b1))
        txd[7:4] <= gm_tx_d[7:4];
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        txd[3:0] <= 4'h0;
    else if((gm_tx_en == 1'b1) && (tx_mac_aclk_en == 1'b1))
        txd[3:0] <= gm_tx_d[3:0];
    else if(((eth_speed == 3'h2) && (aclk_en_cnt == 7'd6)) ||
            ((eth_speed == 3'h1) && (aclk_en_cnt == 7'd51)))
        txd[3:0] <= txd[7:4];
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_en <= 1'b0;
    else if(tx_mac_aclk_en == 1'b1)
        tx_en <= gm_tx_en;
end

always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_er <= 1'b0;
    else if(tx_mac_aclk_en == 1'b1)
        tx_er <= gm_tx_err;
end
