        3'h1 :
            case(rgmii_txc_dly)
            1'b0 ://rgmii_3c48db7e8f7a4061b4268f003b844934 tx clock delay disable.
                if((aclk_en_cnt == 7'd0) || (aclk_en_cnt == 7'd50))
                    txc <= 2'b11;
